type 'a mem_tree
  = EmptyMem
  | NodeMem of ('a mem_tree) * 'a * ('a mem_tree) * 'a

let helper = function
  | Empty -> 0
  | Node (_, x, _) -> x


let max_path_opt t = 
  let rec max_path_aux = function
    | Empty -> Empty
    | Node (left, x, right) -> 
      let left' = max_path_aux left in
      let right' = max_path_aux right in
      Node (left', x + max (helper left') (helper right'), right')
  in
  match max_path_aux t with 
    | Empty -> None
    | Node (_, x, _) -> Some x

